/*

    Is used to generate a new report for the user

    Will need to use the input to send to the backend, possibly redirect to another component

    @Notes: Lyka Marcelino, 04/09/2020

 */
import React from 'react';
import {Form, Button, Dropdown, InputGroup} from 'react-bootstrap';
import Sales from "../components/Sales";
import graphForm from "../components/graphForm";
import {BrowserRouter as Router, Link, Route} from "react-router-dom";

const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    textAlign: "center",
    marginLeft: "220px",
    marginTop: "40px",
    alignContent: "center",
}

const dataRoute = [
    { path: '/graphForm',
        main: () =>  <graphForm/>
    },
]

export const NewReport = (props) => (
    <>
        <div style={{marginLeft: '170px',marginTop: '0px',fontSize: '2rem', fontWeight: 'bold'}}>View your QuickBooks Data</div>
        <Router>
            <div style={{marginLeft: '170px', marginTop:'10px'}}>
                <ul style={{listStyleType: 'none', display:'inline'}}>
                    <Link to="/graphForm" style={{marginRight: '10px'}}>
                        <Button variant="outline-secondary">formPage</Button>{' '}
                    </Link>
                </ul>
                <div>
                    {dataRoute.map((route) => (
                        <Route
                            key={route.path}
                            path={route.path}
                            exact={route.exact}
                            component={route.main}
                        />
                    ))}
                </div>
            </div>
        </Router>

    </>
)
